import logo from "./logo.svg";
import "./App.css";

function Header(){
  return <header>
    <h1><a href="/">WEB</a></h1>
  </header>
}



function App() {


  return (
    <div>
      <Header></Header>
      <ol>
        <li>html</li>
        <li>css</li>
        <li>js</li>

      </ol>
    </div>
  );
}

export default App;
